import React from 'react';
import { useNavigate } from 'react-router-dom';
import bananaa from './bananaa.jpg'; // Ensure this path is correct

const Home = () => {
  const navigate = useNavigate();

  return (
    <div style={{ textAlign: 'center', marginTop: '100px' }}>
      <h1>IQ-Based Math Game</h1>
      <p>Test and improve your problem-solving skills through fun and challenging math questions.</p>
      <button onClick={() => navigate('/signup')}>Play Game</button>
    </div>
  );
};

export default Home;
